import React, {Component} from 'react';

import SlideIn from './SlideIn';

class SlideInTrigger extends Component {
  render(){
  	const {
  		onClick,
  		className,
  	} = this.props;

	    return (
	    	<button 
                	className={className}
                	onClick={onClick}
                	type="button"
				>
				<i className="fa fa-bars fa-fw fa-lg" style={{color: "#cbc5c1"}}></i>
                </button>
		);
	}
}
export default SlideInTrigger;
